  return (
    <section id="about" ref={aboutref} className='h-[100vh] lg:ml-[20%] mt-[5%]'>

       <div className='rounded-heffer bg-gradient-to-r from-cyan-300/90 via-emerald-300/90 to-sky-300/[.95] flex flex-col p-8 mb-8 sm:my-16 lg:mb-16 lg:mr-16 mt-8 4xl:mr-24 5xl:mr-32 6xl:mr-40 items-center text-center' >

       <h1 className="title-font sm:text-4xl text-3xl my-6 md:mb-8 mx-auto font-medium text-white hover:text-indigo-500 drop-shadow cursor-pointer">
          Howdy, I'm About.
        </h1>
       </div>

    </section>
  );
}
